import React from 'react'
import Menu from '@material-ui/core/Menu';
import { makeStyles } from '@material-ui/core/styles';
import AccountCircle from '@material-ui/icons/AccountCircle';
import IconButton from '@material-ui/core/IconButton';
import MenuItem from '@material-ui/core/MenuItem';

export const Acount = ({handleProfileMenuOpen, handleMenuClose, isMenuOpen, anchorEl}) => {
    const useStyles = makeStyles((theme) => ({
        menuAccount:{
            zIndex:100
        }
    }));

    const classes = useStyles();

    const menuId = 'primary-search-account-menu';

    const renderMenu = (
        <Menu
            className={classes.menuAccount}
            anchorEl={anchorEl}
            anchorOrigin={{ vertical: 'top', horizontal: 'right' }}
            id={menuId}
            keepMounted
            transformOrigin={{ vertical: 'top', horizontal: 'right' }}
            open={isMenuOpen}
            onClose={handleMenuClose.bind(this)}
        >
            <MenuItem onClick={handleMenuClose.bind(this)} className={classes.menuAccount}>Profile</MenuItem>
            <MenuItem onClick={handleMenuClose.bind(this)} className={classes.menuAccount}>My account</MenuItem>
        </Menu>
    );

    return (
        <div>
            <IconButton
                edge="end"
                aria-label="account of current user"
                aria-controls={menuId}
                aria-haspopup="true"
                onClick={handleProfileMenuOpen.bind(this)}
                color="inherit"
                >
                <AccountCircle />
            </IconButton>
            {renderMenu}
        </div>
    )
}
